import React from "react";
import "./output.css";
import Sidebar from "./Sidebar";
import Chat from "./Chat";
import { NavLink } from "react-router-dom";

const HomePage = () => {
  return (
    <div className="w-full h-screen bg-[#1c1c1d]">
      <div className="w-full h-full flex gap-5 justify-center items-center">
        <div className="w-[30%] h-[70%] bg-[#373a3f] rounded-lg p-2">
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTqZQV8dJM9wtWJy0602p9N-C9hZxZTFuSn_kKH5A8JcQ&s" className="w-full"/>
        </div>
        <div className="w-[30%] h-[70%] bg-red-200 rounded-lg">
            hello
        </div>
      </div>
    </div>
  );
};

export default HomePage;
